import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { AuthProvider } from './AuthContext';  // Importar el proveedor del contexto
import './App.css';
import Centros from './Centros';
import CentroUnico from './CentroUnico';
import Login from './Login';
import Registro from "./Registro";
import Navbar from './Navbar';
import Logout from './Logout';
import MiCuenta from "./MiCuenta";
import Instalaciones from "./Instalaciones";

function App() {
  return (
    <AuthProvider>  {/* Aquí envolvemos la aplicación con el contexto */}
      <Router>
        <div className="App">
          <Navbar />
          <header>
            <h1>Centros Cívicos</h1>
          </header>

          <Routes>
            <Route path="/" element={<Centros />} />
            <Route path="/centro/:id" element={<CentroUnico />} />
            <Route path="/login" element={<Login />} />
            <Route path="/registro" element={<Registro />} />
            <Route path="/logout" element={<Logout />} />
            <Route path="/mi-cuenta" element={<MiCuenta />} />
            <Route path="/instalaciones" element={<Instalaciones />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
